models = {

}

with io.StringIO(data.strip()) as f:
    reader = csv.DictReader(f, delimiter=',', quoting=csv.QUOTE_NONE)
    for row in reader:
        model_type = row["Model Size"].strip()
        if not model_type:
            continue
        qtype = row["Quantization"].strip()
        ctx_size = int(row["Context Size"].strip())
        memory_spec = [float(row["Model Memory (MB)"].strip()),float(row["Context Memory (MB)"].strip()),float(row["Total Memory (MB)"].strip())]
        # print(model_type, qtype, ctx_size, memory_spec)
        t_models = models.setdefault(model_type, [])
        t_models.append([memory_spec, ctx_size, qtype.split(" ")[0]])
        models[model_type] = t_models


app = typer.Typer()
context_constraints = [512,1024,2048,3072,4096,6144,8192,12288,16384,24576,32768,65536]
@app.command()
def canrunwhat(gpu_memory:float, context_size:int = 4096, select:int=2):
    """
    What Model Can I Run with my gpu memory spec provided?

    gpu_memory (required): Your GPU Memory, defined in Megabytes (1024,4096, etc...).


    --context-size (optional, defaults to 4096): also known as context length.
    
    Basically how far back your model knows about the history of your chats/whatever you told it before. (4096 matches context size with ChatGPT 3.5)

    --select (optional, defaults to 2): There is no need to fiddle around with the value.

    [0 to only look at the model usage, 1 to only look at the context memory and 2 to look at the combined model+context memory usage]
    """
    if context_size not in context_constraints:
        print(f"Your context size: {context_size} does not fall inside the following values: {context_constraints}")
        return
    has_model = False
    for model_type, quants in models.items():
        gpu_filtered = [i for i in quants if i[0][select] < gpu_memory]
        context_filtered = [i for i in gpu_filtered if i[1] == context_size]
        if context_filtered:
            print(f"Runnable Quants for model type: {model_type}")
            for model_quant in context_filtered[-4:]:
                print(f"{model_type}: {model_quant[2]} @ {model_quant[0][2]}Mb of GPU Usage.")
            has_model = True
    if has_model:
        print("For Quants, it's recommended to select the Highest quant available for your model.")
    else:
        print("Your GPU is either too small or there is no quantization that would fit in your context size specified. :(")

if __name__ == "__main__":
    app()